Slurm

```json
{
  "application": "Slurm",
  "details": {
    "resource_requirements": {
      "partition": "batch",
      "nodes": 1,
      "tasks_per_node": 1,
      "cpus_per_task": 1,
      "time": "1-00:00:00"
    },
    "environment_modules": [
      "compilers/gcc/4.9"
    ],
    "script_parameters": {
      "PROJECT_PATH": "Path to the project directory",
      "PYTHON_PATH": "Path to the Python executable",
      "CONFIG_FILE": "Path to the configuration file",
      "CUDA_DEVICE": "CUDA device to use (default: 0)"
    },
    "execution_command": "srun -o logs/%j.out -e logs/%j.err /bin/bash run.sh $PYTHON_PATH $CONFIG_FILE $CUDA_DEVICE",
    "output_files": [
      "logs/%j.out",
      "logs/%j.err"
    ]
  }
}
```
